import React, { useState } from 'react';
import axios from 'axios';
import { RingLoader } from 'react-spinners';
import './App.css';

function App() {
  const [insertKey, setInsertKey] = useState('');
  const [insertValue, setInsertValue] = useState('');
  const [deleteKey, setDeleteKey] = useState('');
  const [searchKey, setSearchKey] = useState('');
  const [searchResult, setSearchResult] = useState(null);
  const [notification, setNotification] = useState([]);
  const [loading, setLoading] = useState(false);
  const [selectedHashing, setSelectedHashing] = useState('extendible');
  const [hashTableState, setHashTableState] = useState(null);

  const handleInsert = async (e) => {
    e.preventDefault();
    if (!insertKey || !insertValue) {
      addNotification('error', 'Key and Value must be provided for insertion.');
      return;
    }

    setLoading(true);
    try {
      const response = await axios.post(`http://127.0.0.1:5000/${selectedHashing}/insert`, {
        key: parseInt(insertKey),
        value: insertValue,
      });

      // Check if response structure is valid
      if (response.data) {
        addNotification('success', response.data.message);
        setHashTableState(response.data.state); // Set the hash table state directly from the response
      } else {
        throw new Error("Invalid response structure");
      }

      setInsertKey('');
      setInsertValue('');
    } catch (error) {
      const errorMessage = error.response?.data?.error || 'Error inserting data: ' + error.message;
      addNotification('error', errorMessage);
    } finally {
      setLoading(false);
    }
  };

  const handleDelete = async (e) => {
    e.preventDefault();
    if (!deleteKey) {
      addNotification('error', 'Key must be provided for deletion.');
      return;
    }

    setLoading(true);
    try {
      const response = await axios.delete(`http://127.0.0.1:5000/${selectedHashing}/delete`, {
        data: { key: parseInt(deleteKey) },
      });

      // Check if response structure is valid
      if (response.data) {
        addNotification('success', response.data.message);
        setHashTableState(response.data.state); // Set the hash table state directly from the response
      } else {
        throw new Error("Invalid response structure");
      }

      setDeleteKey('');
    } catch (error) {
      const errorMessage = error.response?.data?.error || 'Error deleting data: ' + error.message;
      addNotification('error', errorMessage);
    } finally {
      setLoading(false);
    }
  };

  const handleSearch = async (e) => {
    e.preventDefault();
    if (!searchKey) {
      addNotification('error', 'Key must be provided for search.');
      return;
    }

    setLoading(true);
    try {
      const response = await axios.get(`http://127.0.0.1:5000/${selectedHashing}/search?key=${searchKey}`);

      // Check if response structure is valid
      if (response.data) {
        if (response.data.message) {
          setSearchResult(response.data.message);
          addNotification('success', `Found key ${searchKey}: ${response.data.message}`);
        } else {
          addNotification('info', `Key ${searchKey} not found.`);
        }
        setHashTableState(response.data.state); // Set the hash table state directly from the response
      } else {
        throw new Error("Invalid response structure");
      }

      setSearchKey('');
    } catch (error) {
      const errorMessage = error.response?.data?.error || 'Error searching data: ' + error.message;
      addNotification('error', errorMessage);
    } finally {
      setLoading(false);
    }
  };

  const addNotification = (type, message) => {
    const newNotification = { id: new Date().getTime(), type, message };
    setNotification((prev) => [...prev, newNotification]);
  };

  const handleReset = () => {
    setInsertKey('');
    setInsertValue('');
    setDeleteKey('');
    setSearchKey('');
    setSearchResult(null);
    setNotification([]);
  };

  const renderHashTableState = () => {
    if (!hashTableState) return null;

    return (
      <div className="hash-table-state">
        <h2>Hash Table State</h2>
        <p><strong>Global Depth:</strong> {hashTableState.globalDepth}</p>
        <table className="hash-table">
          <thead>
            <tr>
              <th>Bucket Index</th>
              <th>Directory Pointer</th>
              <th>Local Depth</th>
              <th>Bucket Content</th>
            </tr>
          </thead>
          <tbody>
            {hashTableState.buckets.map((bucket, index) => (
              <tr key={index}>
                <td>{index}</td>
                <td>{hashTableState.directory[index]}</td>
                <td>{bucket.localDepth}</td>
                <td>{JSON.stringify(bucket.content)}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  };

  return (
    <div className="app-container">
      <div className="App">
        <div className="main-content">
          <h1>Hash Table Visualization</h1>
          <div>
            <label>Select Hashing Method:</label>
            <select
              value={selectedHashing}
              onChange={(e) => setSelectedHashing(e.target.value)}
              style={{ margin: '10px 0' }}
            >
              <option value="extendible">Extendible Hashing</option>
              <option value="linear">Linear Hashing</option>
            </select>
          </div>

          <form onSubmit={handleInsert} className="form-section">
            <h2>Insert</h2>
            <input
              type="number"
              placeholder="Key"
              value={insertKey}
              onChange={(e) => setInsertKey(e.target.value)}
            />
            <input
              type="text"
              placeholder="Value"
              value={insertValue}
              onChange={(e) => setInsertValue(e.target.value)}
            />
            <button type="submit">Insert</button>
          </form>

          <form onSubmit={handleDelete} className="form-section">
            <h2>Delete</h2>
            <input
              type="number"
              placeholder="Key"
              value={deleteKey}
              onChange={(e) => setDeleteKey(e.target.value)}
            />
            <button type="submit">Delete</button>
          </form>

          <form onSubmit={handleSearch} className="form-section">
            <h2>Search</h2>
            <input
              type="number"
              placeholder="Key"
              value={searchKey}
              onChange={(e) => setSearchKey(e.target.value)}
            />
            <button type="submit">Search</button>
          </form>

          {loading && (
            <div className="loading-indicator">
              <RingLoader size={50} color={'#123abc'} loading={loading} />
            </div>
          )}

          <div className="reset-container">
            <button onClick={handleReset}>Reset</button>
          </div>

          {searchResult && (
            <div className="search-result">
              <h3>Search Result:</h3>
              <p>{searchResult}</p>
            </div>
          )}

          {renderHashTableState()}
        </div>

        <div className="notification-panel">
          <h2>Notifications</h2>
          {notification.map((note) => (
            <div key={note.id} className={`notification ${note.type}`}>
              <span>{note.message}</span>
              <button onClick={() => setNotification(notification.filter((n) => n.id !== note.id))}>
                âœ–
              </button>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default App;
